import React, { useState } from "react";
import '../assets/styles/CareerBento.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMapMarkerAlt, faChartLine, faTools, faBookOpen, faAward, faImages, faChevronRight } from '@fortawesome/free-solid-svg-icons';

const imgMumbai = require('../assets/images/1.png'); 
const imgNYC = require('../assets/images/2.png'); 
const imgDegree = require('../assets/images/1.png'); 
const imgConvocation = require('../assets/images/2.png'); 

interface CareerEntry {
  type: 'work' | 'education';
  org: string;
  title: string;
  location: string;
  date: string;
  logo: string;
  url: string;
  details: string[];
  impact?: string;
  tools?: string[];
  courses?: string[];
  achievements?: string[];
  gallery?: string[];
}

type EntryKey = 'mumbai_univ' | 'lti' | 'binghamton' | 'klaw';

function CareerBento() {
  const [activeTab, setActiveTab] = useState<EntryKey>('klaw');

  const careerData: Record<EntryKey, CareerEntry> = {
    mumbai_univ: {
      type: 'education',
      org: "University of Mumbai",
      title: "Bachelor of Engineering",
      location: "Mumbai, India",
      date: "2017 — 2021",
      logo: "https://medcounsel.in/PG/images/1642173662.png",
      url: "https://mu.ac.in/",
      gallery: [imgDegree, imgConvocation],
      courses: ["Data Structures", "Algorithms", "Operating Systems", "DB Management"],
      achievements: ["Social Media Head @ Alumni Cell", "Senior Photographer @ Shutterbugs", "Paper Publication: Automated Systems"],
      details: ["Computer Engineering Major.", "Graduated First Class with Distinction."]
    },
    lti: {
      type: 'work',
      org: "LTIMindtree",
      title: "Software Engineer",
      location: "Mumbai, India",
      date: "2021 — 2023",
      logo: "https://companieslogo.com/img/orig/LTIM.NS-dea59dc6.png?t=1720244492",
      url: "https://www.ltimindtree.com/",
      impact: "65% Latency Reduction in Finance Microservices",
      tools: ["Java", "Spring Batch", "Drools", "SQL"],
      details: ["Optimized financial microservices and business logic.", "Migrated legacy PL/SQL into Drools engines."]
    },
    binghamton: {
      type: 'education',
      org: "Binghamton University",
      title: "Master of Science, CS",
      location: "New York, USA",
      date: "2023 — 2025",
      logo: "https://upload.wikimedia.org/wikipedia/en/6/67/State_University_of_New_York_at_Binghamton_Seal.png",
      url: "https://www.binghamton.edu/",
      gallery: [imgNYC], 
      courses: ["Data Science", "Cloud Computing", "Design Patterns", "Network Security"],
      achievements: ["Graduate Assistantship", "Maintaining 3.9+ GPA"],
      details: ["Specialization in Data Science & Systems."]
    },
    klaw: {
      type: 'work',
      org: "KLAW Industries",
      title: "Software Engineer Intern",
      location: "Binghamton, NY",
      date: "2024 — 2025",
      logo: "https://images.squarespace-cdn.com/content/v1/5cfee7779de45a000197fd31/1622649420794-QC687JBOL698CEBAZOTH/KLAW+Industries+Transparent.png",
      url: "https://www.klawindustries.com/",
      impact: "40% Faster Ingestion for Multi-sensor Data",
      tools: ["AWS IoT", "Timestream", "Kinesis", "Linux"],
      details: ["Designed telemetry ingestion services.", "Built scalable video pipelines."]
    }
  };

  const current = careerData[activeTab];

  return (
    <div className="career-wide-container" id="career">
      <div className="content-shell">
        {/* LEFT SIDEBAR: Far Left Alignment */}
        <div className="timeline-nav">
          {(Object.keys(careerData) as EntryKey[]).map((key) => (
            <div 
              key={key} 
              className={`nav-point ${activeTab === key ? 'active' : ''}`}
              onClick={() => setActiveTab(key)}
            >
              <div className="line-anchor"></div>
              <div className="label-block">
                <span className="t-date">{careerData[key].date}</span>
                <span className="t-org">{careerData[key].org.split(' ')[0]}</span>
              </div>
            </div>
          ))}
        </div>

        {/* RIGHT AREA: Expanded Details */}
        <div className="main-stage">
          <div className="stage-header">
            <div className="org-branding">
              <a href={current.url} target="_blank" rel="noopener noreferrer">
                <img src={current.logo} alt="Org Logo" className="stage-logo" />
              </a>
              <div className="title-stack">
                <h2>{current.org}</h2>
                <p className="sub-meta">{current.title} <FontAwesomeIcon icon={faChevronRight} className="sep" /> {current.location}</p>
              </div>
            </div>
          </div>

          <div className="stage-body">
            {/* Direct Sections instead of Bento Tiles */}
            <section className="body-section">
              <h4 className="section-label">{current.type === 'work' ? 'Impact' : 'Coursework'}</h4>
              {current.type === 'work' ? (
                <p className="impact-text">{current.impact}</p>
              ) : (
                <div className="tag-cloud">
                  {current.courses?.map(c => <span key={c} className="simple-tag">{c}</span>)}
                </div>
              )}
            </section>

            <div className="row-split">
              <section className="body-section flex-2">
                <h4 className="section-label">Summary & Achievements</h4>
                <ul className="clean-list">
                  {current.details.map((d, i) => <li key={i}>{d}</li>)}
                  {current.achievements?.map((a, i) => <li key={`a-${i}`} className="achieve-li"><FontAwesomeIcon icon={faAward} className="icon-s" /> {a}</li>)}
                </ul>
              </section>

              {current.gallery && (
                <section className="body-section flex-1">
                   <h4 className="section-label">Visuals</h4>
                   <div className="flat-gallery">
                      {current.gallery.map((img, i) => <img key={i} src={img} alt="Degree" />)}
                   </div>
                </section>
              )}
            </div>

            {current.tools && (
              <section className="body-section">
                <h4 className="section-label">Tech Stack</h4>
                <div className="tag-cloud">
                  {current.tools.map(t => <span key={t} className="simple-tag outline">{t}</span>)}
                </div>
              </section>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default CareerBento;
